23	V/v thực hiện Báo cáo tốt nghiệp (BCTN) lớp D16HT	<p>Sinh vi&ecirc;n thực hiện BCTN lưu &yacute; một số vấn đề sau:</p>\r\n\r\n<p><strong>1. Quyết định ch&iacute;nh thức giao đề t&agrave;i c&oacute; thể lấy ở link sau:</strong></p>\r\n\r\n<p><a href="https://drive.google.com/drive/folders/1PMqxBvK5pxnCegU71GEuCsXq7bvlfy0g?usp=sharing" target="_blank">https://drive.google.com/drive/folders/1PMqxBvK5pxnCegU71GEuCsXq7bvlfy0g?usp=sharing</a></p>\r\n\r\n<p><strong>2. Thực hiện đề t&agrave;i:</strong></p>\r\n\r\n<p><strong>&nbsp;a. Tiến độ:</strong></p>\r\n\r\n<p>Sinh vi&ecirc;n điền tiến độ theo mẫu (dưới sự&nbsp; hướng dẫn của GVHD)&nbsp;<strong>nộp về Thư k&yacute; chương tr&igrave;nh trước ng&agrave;y 20/06/2020</strong>&nbsp;để thư k&yacute; chương tr&igrave;nh tổng hợp, Chương tr&igrave;nh căn cứ xếp lịch bảo vệ đề t&agrave;i.</p>\r\n\r\n<p><strong>b. Bảo vệ đề t&agrave;i</strong></p>\r\n\r\n<p>&nbsp; - Mỗi sinh vi&ecirc;n tạo một folder theo lớp trong&nbsp;thư mục Nộp b&aacute;o c&aacute;o,&nbsp;<strong>đặt t&ecirc;n folder theo quy c&aacute;ch: MSSV_hotenSV</strong>. Trong folder n&agrave;y, sinh vi&ecirc;n nộp:&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; + File word b&aacute;o c&aacute;o theo mẫu.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;+ File thuyết tr&igrave;nh b&aacute;o c&aacute;o.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;+ Source code của chương tr&igrave;nh (up l&ecirc;n github v&agrave; gửi lại link).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;+ Video demo của đề t&agrave;i.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;+ Phiếu theo d&otilde;i tiến độ thực hiện,</p>\r\n\r\n<p>&nbsp;- Thời gian bảo vệ: dự kiến ng&agrave;y 9-10/07/2020.</p>\r\n\r\n<p>&nbsp;- T&oacute;m tắt nội dung của đề t&agrave;i theo link đ&iacute;nh k&egrave;m</p>\r\n\r\n<p><strong>3. Link th&ocirc;ng tin&nbsp;</strong></p>\r\n\r\n<p>&nbsp;- Link tải biểu mẫu li&ecirc;n quan:</p>\r\n\r\n<p><a href="https://drive.google.com/drive/folders/1SafkKTMgszWtZfgJ6IUcm358SzzJUcUz?usp=sharing" target="_blank">https://drive.google.com/drive/folders/1SafkKTMgszWtZfgJ6IUcm358SzzJUcUz?usp=sharing</a></p>\r\n\r\n<p>&nbsp;-&nbsp;<strong>Link nộp b&aacute;o c&aacute;o:&nbsp;</strong></p>\r\n\r\n<p>&nbsp;<a href="https://drive.google.com/drive/folders/1v-9p7k9oCaHwaNTeYVuSscZAc66pWJI-?usp=sharing" target="_blank">https://drive.google.com/drive/folders/1v-9p7k9oCaHwaNTeYVuSscZAc66pWJI-?usp=sharing</a></p>\r\n\r\n<p>-&nbsp;<strong>Link điền t&oacute;m tắt nội dung đề t&agrave;i theo lớp:</strong></p>\r\n\r\n<p><a href="https://docs.google.com/spreadsheets/d/1pQSvg5lDuBFVgT5h9drBLX62BjrnfgI4/edit#gid=2062784033" target="_blank">https://docs.google.com/spreadsheets/d/1pQSvg5lDuBFVgT5h9drBLX62BjrnfgI4/edit#gid=2062784033</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Nếu c&oacute; thắc mắc g&igrave;, c&aacute;c em c&oacute; thể li&ecirc;n hệ GVHD để được hướng dẫn th&ecirc;m.</p>	2020-05-25	\N	\N	admin
